$(document).ready(function () {












    $.ajax({
        type: "POST",
        url: "../ProjectStaff/PGeneral/Services.aspx/getDepartements",
        //url: "../PEmp_PSService/getDesignations",
        contentType: "application/json; charset=utf-8",
        dataType: "json",
        async: false,
        processData: false,
        success: function (result) {
            //alert(result.d);
            var jResOthFac = JSON.parse(result.d);
            //            $('#txtEHDesg')
            //                    .empty()
            //                    .append('<option value="Select Designation*">Select Designation*</option>');
            //            $('#txtEHPrvDesg')
            //                    .empty()
            //                    .append('<option  value="Select Previous Designation*">Select Previous Designation*</option>')
            for (var i in jResOthFac) {
                $("#ddlCentre").append('<option value="' + jResOthFac[i].Dept + '">' + jResOthFac[i].Dept + '</option>');
            }

        },
        error: function (result) {
            alert(JSON.parse(result.responseText).Message);
            //alert((result.responseText));
        }
    });
    $("#ddlCentre").change(function () {
        $("#ddlProfType").prop("selectedIndex", 0);
        $("#ddlEmp").prop("disabled", true);
    });
    $("#ddlProfType").change(function () {
        //alert('on centre change');
        if ($(this).prop('selectedIndex') > 0) {
            $.ajax({
                type: "POST",
                url: "../ProjectStaff/PGeneral/Services.aspx/getEmpByCentreEmpGroup",
                contentType: "application/json; charset=utf-8",
                dataType: "json",
                data: JSON.stringify({ empGroup: $('#ddlEmpGrp').val(), dept: $('#ddlCentre').val(), profType: $('#ddlProfType').val() }),
                async: false,
                processData: false,
                success: function (result) {
                    //alert(result.d);
                    var jResOthFac = JSON.parse(result.d);
                    $("#ddlEmp").prop("disabled", false);
                    $('#ddlEmp')
                    .empty()
                    .append('<option selected="selected" value="">Select Employee*</option>')
                    for (var i in jResOthFac) {
                        $("#ddlEmp").append('<option value="' + jResOthFac[i].EmpID + '">' + jResOthFac[i].Name + '</option>');
                    }

                },
                error: function (result) {
                    alert(JSON.parse(result.responseText).Message);
                }
            });

        }
    });

    $("#btnFillEmp").click(function () {
        try {
            if (checkValidationsForChooseEmp()) {
                $('#EmpSHPnls').show();
                getPREMPBasicInfoForHR();
                $('#bscForHR').show();
                $("#ddlEmpGrp").prop("disabled", true);
                $("#ddlCentre").prop("disabled", true);
                $("#ddlProfType").prop("disabled", true);
                $("#ddlEmp").prop("disabled", true);
            }
            else {
                reset();
                alert('Please select employee to fill the service history....');
            }
        }
        catch (e) { throw e; }
        return false;
    });

    function reset() {
        $('#ddlEmpGrp').prop('selectedIndex', 0);
        $('#ddlCentre').prop('selectedIndex', 0);
        $("#ddlProfType").prop("selectedIndex", 0);
        $('#ddlEmp').prop('selectedIndex', 0);

        $("#ddlEmpGrp").prop("disabled", false);
        $("#ddlCentre").prop("disabled", false);
        $("#ddlProfType").prop("disabled", false);
        $("#ddlEmp").prop("disabled", false);
        $('#EmpSHPnls').hide();
        $('#bscForHR').hide();
    }
    $("#btnRstEmpDetls").click(function () {
        reset();
    });

    function checkValidationsForChooseEmp() {
        //alert('Validation');
        if ($('#ddlEmpGrp')[0].checkValidity() && $('#ddlCentre')[0].checkValidity() && $('#ddlEmp')[0].checkValidity() && $('#ddlProfType')[0].checkValidity()) {
            return true
        }
        else {
            return false;
        }
    }
    function getPREMPBasicInfoForHR() {
        $.ajax({
            type: "POST",
            url: "../ProjectStaff/PGeneral/Services.aspx/getPRBasicInfoForHR",
            contentType: "application/json; charset=utf-8",
            dataType: "json",
            async: false,
            data: JSON.stringify({ EMPId: $("#ddlEmp").val() }),
            processData: false,
            success: function (result) {
                //alert('Basic info : ' + result.d);
                var jResBInfo = JSON.parse(result.d);
                $(".bscForHR").html(populateBasicInfo(jResBInfo));
                displaydata();
                displayEHdata();
                getPREMPBasicInfo();
                loadWithOtherWithDefaults();
                displayDelcaration();                
            },
            error: function (result) {
                alert(JSON.parse(result.responseText).Message, "alert alert-danger", "");
            }
        });

    }

    function populateBasicInfo(data) {
        //var ppath = 'http://erp.nirdpr.in/(S(moidlxynti4yz4njvo1rz13h))/SPhotos/' + data.photo; //<thead class='thead-dark'><tr><th>Basic Information</th><th></th><th></th><th></th><th></th></tr></thead>
        var ppath = '../../SPhotos/' + data.photo;

        //var imgdata = 'data:image/png;base64,';
        var str = "<div class='table-responsive' style='width:100%'><table id='ForHRBasicInfo' class='a table table-striped table-hover'>" +
                    "<tbody><tr><td>Employee No.</td><td>" + data.EmpID + "</td><td>Name</td><td>" + data.Name + "</td><td rowspan='4' align='center'><img id='HRempPhoto' src='" + ppath + "' width='100' height='120' alt='" + data.Name + "'/></td></tr>" +
                    "<tr><td>Email</td><td>" + data.Email + "</td><td>Mobile No.</td><td>" + data.Mobile + "</td></tr>" +
        //"</tbody></table><br><table id='jndtls' class='table table-striped table-hover'><thead class='thead-dark'>"+
                "<tr><td colspan='4' class='innerHeader'><span id='jdHR' style='font-weight:bold'>Joining details</span></td></tr>" +
                    "<tr><td>Date of Joining</td><td>" + data.DoJ + "</td><td>Designation</td><td>" + data.Design + "</td></tr><tr><td>Salary</td><td>" + data.BasicPay + "</td><td>Project Coordinator</td><td colspan='2'>" + data.ProjectCoordinator + "</td></tr>" +
                    "<tr><td>Project Title</td><td colspan='2'>" + data.ProjectTitle + "</td><td>Centre & Head</td><td>" + data.head + "</td></tr>" +
                    "</tbody></table></div>";
        //alert(str);
        return str;
    }



});